CREATE TABLE `think_activity_copy` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `img` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '头部图片',
  `title` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '标题',
  `point` int DEFAULT '0' COMMENT '积分数量',
  `quota` int DEFAULT '1' COMMENT '活动名额',
  `num` int DEFAULT '0' COMMENT '已报名人数',
  `tclass_id` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '活动所属分类',
  `community_id` int DEFAULT '1' COMMENT '社区id',
  `type_id` int DEFAULT NULL COMMENT '分类所属',
  `area` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '区域',
  `site` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '地址',
  `user_id` int NOT NULL COMMENT '用户id',
  `tel` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '联系方式',
  `official` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '主办方',
  `end_time` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '活动结束时间',
  `start_time` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '活动开始时间',
  `longitude` varchar(20) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT '104.0667' COMMENT '经度',
  `latitude` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT '30.6667' COMMENT '纬度',
  `content` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '内容',
  `status_integral` enum('0','1') CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '0' COMMENT '积分状态',
  `status` enum('1','0','3','2') CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT '1' COMMENT '状态:0禁用;1:招募中,2,已满,3已结束',
  `create_time` char(10) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '添加时间',
  `update_time` char(10) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=159 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=DYNAMIC COMMENT='活动详情表';
