: rgb(153, 153, 153); display: inline-block; margin-left: 8rpx; padding-left: 8rpx; max-width: 440rpx; border-left: 1rpx solid rgb(238, 238, 238); line-height: 1; text-overflow: ellipsis; overflow: hidden; vertical-align: -2rpx;\">北京传奇极客管理咨询有限公司,财经领域创作者</span></p><p><img class=\"large\" data-loadfunc=\"0\" src=\"https://pics3.baidu.com/feed/95eef01f3a292df552d61fda73e1cc6736a873c4.png?token=cd003606b30e101e239209d87003074e\" data-loaded=\"0\" style=\"border: 0rpx; width: 600rpx; display: block;\"/></p><p style=\"margin-top: 26rpx; margin-bottom: 0rpx; padding: 0rpx; font-size: 16rpx; line-height: 24rpx; color: rgb(51, 51, 51); text-align: justify;\">蚂蚁集团打新资金退款到账，每签利息 2.01 元</p><p style=\"margin-top: 22rpx; margin-bottom: 0rpx; padding: 0rpx; font-size: 16rpx; line-height: 24rpx; color: rgb(51, 51, 51); text-align: justify;\"><span class=\"bjh-p\">11 月 10 日，据证券日报消息，部分投资者表示，证券账户显示中签蚂蚁集团新股后缴纳的钱款连带利息已经退回。其中一位姓徐的女士表示，「已如期收到此前缴纳的蚂蚁集团 500 股新股的认购资金 34400 元，以及 2.01 元利息。」</span></p><p style=\"margin-top: 22rpx; margin-bottom: 0rpx; padding: 0rpx; font-size: 16rpx; line-height: 24rpx; color: rgb(51, 51, 51); text-align: justify;\"><span class=\"bjh-p\">报道指出，蚂蚁集团在监管部门的协助与监督下，退款较为及时，退回冻结的申购资金及同期银行存款利息，一定程度上利于保护投资者权益。（来源：证券日报）</span></p><p style=\"margin-top: 22rpx; margin-bottom: 0rpx; padding: 0rpx; font-size: 16rpx; line-height: 24rpx; color: rgb(51, 51, 51); text-align: justify;\">传软银拟作价 10 亿美元出售波士顿动力，韩国现代接手</p><p style=\"margin-top: 22rpx; margin-bottom: 0rpx; padding: 0rpx; font-size: 16rpx; line-height: 24rpx; color: rgb(51, 51, 51); text-align: justify;\"><span class=\"bjh-p\">11 月 10 日，据彭博社消息，知情人士说，软银集团正在谈判将机器人制造商波士顿动力公司出售给现代汽车公司。知情人士表示，拟议中的交易条款价值10亿美元，将使现代公司获得波士顿动力公司的控制权。不过，最终条款尚未敲定，这笔交易仍有可能会破裂。</span></p><p><br/></p>',1,'1','1604970626','1604970626'),(25,'习近平出席二十国集团领导人第十五次峰会第二阶段会议','https://bank.guaishe.com/uploads/article/20201123/beb78ead730489e54f8e5683e36bf936.jpg','<h1 class=\"dabiaoti\" style=\"margin: 0rrrpx; padding: 0rrrpx; text-align: center; color: rgb(51, 5