16/i2.png&quot;); background-position: initial; background-size: initial; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; text-decoration-line: none; display: block; width: 21rrrpx; cursor: pointer;\">&nbsp;</a></p><p><a title=\"分享到微信\" id=\"weixinqrcode\" class=\"weixinqrcode\" href=\"http://cn.chinadaily.com.cn/a/202011/23/WS5fbb071da3101e7ce9730fad.html#\" shape=\"rect\" style=\"margin: 0rrrpx 0rrrpx 0rrrpx 10rrrpx; padding: 0rrrpx; float: right; color: rgb(102, 102, 102); font-family: 宋体; line-height: 24rrrpx; background-image: url(&quot;https://cn.chinadaily.com.cn/image/2016/i3.png&quot;); background-position: initial; background-size: initial; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; text-decoration-line: none; display: block; width: 21rrrpx;\">&nbsp;</a></p><p>分享</p><p style=\"margin-top: 0rrrpx; margin-bottom: 30rrrpx; padding: 0rrrpx; color: rgb(51, 51, 51); line-height: 30rrrpx; text-indent: 2em;\">新华社北京11月22日电 国家主席习近平22日晚在北京以视频方式出席二十国集团领导人第十五次峰会第二阶段会议，重点阐述关于可持续发展问题的看法。</p><p style=\"text-align:center;margin-top: 0rrrpx; margin-bottom: 30rrrpx; padding: 0rrrpx; color: rgb(51, 51, 51); line-height: 30rrrpx; text-indent: 2em;\"><img src=\"/ueditor/php/upload/image/20201123/1606121455.jpg\" alt=\"\" id=\"img-5fbb06d9e4b0fbee201ca51c\" style=\"margin: 0rrrpx; padding: 0rrrpx; border: none; max-width: 100%;\"/></p><p style=\"margin-top: 0rrrpx; margin-bottom: 30rrrpx; padding: 0rrrpx; color: rgb(51, 51, 51); line-height: 30rrrpx; text-indent: 2em;\">11月22日晚，国家主席习近平在北京以视频方式出席二十国集团领导人第十五次峰会第二阶段会议，重点阐述关于可持续发展问题的看法。 新华社记者 王晔 摄</p><p style=\"margin-top: 0rrrpx; margin-bottom: 30rrrpx; padding: 0rrrpx; color: rgb(51, 51, 51); line-height: 30rrrpx; text-indent: 2em;\">习近平指出，要打造包容性、可持续、有韧性的未来，不断推进全球减贫事业至关重要。面对新冠肺炎疫情冲击，我们比以往任何时候都更需要拿出切实举措。</p><p><br/></p>',1,'1','1606121510','1606122493'),(26,'习大大','https://bank.guaishe.com/uplo